import '../css/story.css';


function Story() {
  return (
    <div className="Story">
       <p className="topic">STORY</p> 
      <div className="StoryFrame">
        <div className="Content">
        <h6 className="font" >เทศกาลเจ เริ่มขึ้นเมื่อประมาณ 400 ปีมาแล้วในประเทศจีน<br></br>
        เกิดขึ้นในสมัยที่ชาวจีนถูกแมนจูเข้ามาปกครอง และบังคับชนชาติจีนยอมรับวัฒนธรรมของตน<br></br>
        สมัยนั้นเองมีคนจีนกลุ่มหนึ่งรวมตัวกันต่อต้านแมนจูโดยใช้หลักทางธรรมเข้าร่วมด้วย<br></br>
        ชาวจีนกลุ่มนี้นุ่งขาว ห่มขาว และไม่รับประทานเนื้อสัตว์ ตามความเชื่อว่า การประพฤติปฏิบัติ<br></br>
        ตามแนวทางนี้จะช่วยสร้างความเข้มแข็งให้กับตนเองได้คนกลุ่มนี้เรียกตัวเองว่า “หงี่หั่วท้วง” <br></br> </h6>
      </div>
      </div>
    </div>
  );
}

export default Story;
